import Carousel from 'react-bootstrap/Carousel';
import { StarWarsCarouselModels } from "../models";

function StarWarsCarousel() {





  return (
    <Carousel variant="dark">
      <Carousel.Item>
        <img
          className="a-block w-10"
          src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ0tVqZc1Q5004zWqlDE1jpl6AEXfJpWDlEnQ&usqp=CAU"
          alt="First slide"
        />        
      </Carousel.Item>

      <Carousel.Item>
        <img
          className="d-block w-10"
          src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQm1YIlVV8FGPsea09shT02ioKvbq02eH-3DQ&usqp=CAU"
          alt="First slide"
        />        
      </Carousel.Item>


    </Carousel>
  );
}

export default StarWarsCarousel;
